import React, { useState } from "react";
import Form from "./component1/Form";
import Main from "./component2/Main";

function App() {
  const [newMemberData, setNewMemberData] = useState("");
  const [openForm, setOpenForm] = useState(false);

  const newMemberDetail = (item) => {
    setNewMemberData([...newMemberData, item]);
  };

  return (
    <div>
      <h2>Welcome to Gismle management App</h2>
      <button
        onClick={() => {
          setOpenForm(true);
        }}
      >
        Open
      </button>
      <h4 className="time">{new Date().toLocaleString()}</h4>
      (openForm &&{" "}
      <Form newMemberDetail={newMemberDetail} newMemberData={newMemberData} />)
      <Main />
    </div>
  );
}

export default App;
